selector_to_html = {"a[href=\"how-to/newspapers/get-newspaper-issue-article-pdfs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.2. </span>Get a newspaper issue or article as a PDF<a class=\"headerlink\" href=\"#get-a-newspaper-issue-or-article-as-a-pdf\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">13.2.1. </span>Get a PDF of an issue<a class=\"headerlink\" href=\"#get-a-pdf-of-an-issue\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"accessing-data/data-access-options.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">8. </span>Data access options<a class=\"headerlink\" href=\"#data-access-options\" title=\"Permalink to this heading\">#</a></h1><p>This section documents methods for obtaining <span class=\"xref std std-term\">machine-readable data</span> from Trove. You can manually download some types of data, such as images, from Trove\u2019s web interface. But the focus here is on reusable and extensible methods that can be used in a variety of workflows, such as the creation of datasets for further analysis.</p><p>There are a number of ways in which you can access data from Trove:</p>", "a[href=\"accessing-data/trove-lists.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Trove lists<a class=\"headerlink\" href=\"#trove-lists\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">11.1. </span>Metadata<a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><h3>Getting list metadata using the web interface<a class=\"headerlink\" href=\"#getting-list-metadata-using-the-web-interface\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"genindex.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Index<a class=\"headerlink\" href=\"#index\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"what-is-trove/metadata-and-digital-objects.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">3. </span>Metadata and digital objects<a class=\"headerlink\" href=\"#metadata-and-digital-objects\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"what-is-trove/categories-and-zones.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">2. </span>Categories and zones<a class=\"headerlink\" href=\"#categories-and-zones\" title=\"Permalink to this heading\">#</a></h1><p>Trove\u2019s resources are divided into <strong>categories</strong>. Understanding the nature and content of these categories will help you construct effective searches and access useful data.</p><p>There are nine categories in Trove:</p>", "a[href=\"what-is-trove/works-and-versions.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">4. </span>Works and versions<a class=\"headerlink\" href=\"#works-and-versions\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#welcome-to-the-trove-data-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Welcome to the Trove Data Guide<a class=\"headerlink\" href=\"#welcome-to-the-trove-data-guide\" title=\"Permalink to this heading\">#</a></h1><p>This guide will help you develop a critical understanding of Trove as a source for digital research.</p>", "a[href=\"accessing-data/newspapers-and-gazettes-pages.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.2. </span>Accessing data about newspaper &amp; gazette pages<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-pages\" title=\"Permalink to this heading\">#</a></h1><h2><a class=\"toc-backref\" href=\"#id3\" role=\"doc-backlink\">Metadata</a><a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><p><mark>==Include something about the different ways pages are represented \u2013 as images with identifiers, as consecutive numbers in navigation, and as labels.==</mark></p><p>There is no direct method for requesting metadata about a newspaper page in Trove. You can, however, get some information about pages from issues and articles.</p>", "a[href=\"references.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">References<a class=\"headerlink\" href=\"#references\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/newspapers/newspapers-and-gazettes.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13. </span>Newspaper and gazettes how to\u2026<a class=\"headerlink\" href=\"#newspaper-and-gazettes-how-to\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/newspapers-and-gazettes-titles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.4. </span>Accessing data about newspaper &amp; gazette titles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-titles\" title=\"Permalink to this heading\">#</a></h1><p>\u2018Titles\u2019 in this context refers to the names of the publications whose articles are digitised in Trove. For example: <em>Canberra Times</em>, <em>Sydney Morning Herald</em>, or <em>Commonwealth of Australia Gazette</em>.</p>", "a[href=\"types-of-data/types-of-data.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">6. </span>Types of data<a class=\"headerlink\" href=\"#types-of-data\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"pathways/pathways.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">12. </span>Research pathways<a class=\"headerlink\" href=\"#research-pathways\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"understanding-search/understanding-search.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">7. </span>Understanding search<a class=\"headerlink\" href=\"#understanding-search\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"how-to/newspapers/querypic.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.1. </span>Visualising newspaper searches with QueryPic<a class=\"headerlink\" href=\"#visualising-newspaper-searches-with-querypic\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"glossary.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Glossary<a class=\"headerlink\" href=\"#glossary\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"what-is-trove/trove-is.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1. </span>Trove is\u2026<a class=\"headerlink\" href=\"#trove-is\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"what-is-trove/links-and-identifiers.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">5. </span>Links and identifiers<a class=\"headerlink\" href=\"#links-and-identifiers\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/newspapers-and-gazettes.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10. </span>Newspapers and gazettes<a class=\"headerlink\" href=\"#newspapers-and-gazettes\" title=\"Permalink to this heading\">#</a></h1><p><mark>==This might link to a fuller discussion in the contexts section?==</mark></p><p>Before you start requesting data from Trove\u2019s digitised newspapers, it\u2019s worth thinking a bit about the way newspapers are represented in Trove and the relationships between <strong>articles</strong>, <strong>pages</strong>, <strong>issues</strong>, and <strong>titles</strong>. You might think that newspapers are organised in a simple hierarchical structure with titles at the top, and articles at the bottom, but it\u2019s not quite that straighforward. Articles are linked to both pages and titles. Titles have their own API endpoint that can lead you to issues, though following an issue url will actually take you to a page. Pages have identifiers, and you can browse their contents in the Trove web interface, but they don\u2019t exist as separate entities in the API. These sorts of oddities mean that sometimes there\u2019s no direct route to the information that you want, but by thinking about what is connected to what, you can find alternative paths. For example, while there\u2019s no direct link between issues and articles, if you get the publication date and title from an issue, you can then search for articles published in that issue by using the <code class=\"docutils literal notranslate\"><span class=\"pre\">date</span></code> index and <code class=\"docutils literal notranslate\"><span class=\"pre\">title</span></code> facet.</p>", "a[href=\"accessing-data/trove-api-intro.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">9. </span>Trove API introduction<a class=\"headerlink\" href=\"#trove-api-introduction\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">9.1. </span>Types of requests:<a class=\"headerlink\" href=\"#types-of-requests\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"demo.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Jupyter Book demo page<a class=\"headerlink\" href=\"#jupyter-book-demo-page\" title=\"Permalink to this heading\">#</a></h1><p>Trove is not one thing. <span id=\"id1\">[<a class=\"reference internal\" href=\"references.html#id18\" title=\"Tim Sherratt. Hacking Heritage: Understanding the Limits of Online Access. In H Lewi, W Smith, D von Lehn, and S Cooke, editors, The Routledge International Handbook of New Digital Practices in Galleries, Libraries, Archives, Museums and Heritage Sites, pages 116\u2013130. Routledge, London, 2019. doi:10.5281/zenodo.5035855.\">Sherratt, 2019</a>]</span></p>", "a[href=\"how-to/newspapers/create-newspaper-articles-dataset.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.4. </span>How to create a dataset of digitised newspaper articles<a class=\"headerlink\" href=\"#how-to-create-a-dataset-of-digitised-newspaper-articles\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"accessing-data/newspapers-and-gazettes-issues.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.3. </span>Accessing data about newspaper &amp; gazette issues<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-gazette-issues\" title=\"Permalink to this heading\">#</a></h1><h2><a class=\"toc-backref\" href=\"#id1\" role=\"doc-backlink\">Metadata</a><a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><h3><a class=\"toc-backref\" href=\"#id2\" role=\"doc-backlink\">Get the number of issues per year for a title</a><a class=\"headerlink\" href=\"#get-the-number-of-issues-per-year-for-a-title\" title=\"Permalink to this heading\">#</a></h3><p>You can use the <code class=\"docutils literal notranslate\"><span class=\"pre\">newspaper/title</span></code> and <code class=\"docutils literal notranslate\"><span class=\"pre\">gazette/title</span></code> endpoints to get the total number of digitised issues per year for a newspaper or gazette title. You just add the <code class=\"docutils literal notranslate\"><span class=\"pre\">include</span></code> parameter and set its value to <code class=\"docutils literal notranslate\"><span class=\"pre\">years</span></code>.</p><p><a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fnewspaper%2Ftitle%2F11%3Fencoding%3Djson%26include%3Dyears\"><img alt=\"Try it!\" src=\"_images/try-trove-api-console.svg\"/></a></p>", "a[href=\"accessing-data/newspapers-and-gazettes-articles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.1. </span>Accessing data about newspaper and gazette articles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-and-gazette-articles\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"Screenshot of Trove web interface displaying basic article metadata\" src=\"_images/trove-article-metadata.png\"/></p>", "a[href=\"introduction/introduction.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Introduction<a class=\"headerlink\" href=\"#introduction\" title=\"Permalink to this heading\">#</a></h1><p>We all know how to use <a class=\"reference external\" href=\"https://trove.nla.gov.au/\">Trove</a>. You just type your search terms into the box and click the button. You then work your way through the first few pages of results, saving anything that looks useful. If, for example, I\u2019m interested in the development of radio in Australia, I could search for the term \u2018radio\u2019 in Trove\u2019s digitised newspapers. It\u2019s easy!</p>", "a[href=\"how-to/newspapers/international-newspaper-titles.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">13.3. </span>Get a list of \u2018International\u2019 newspapers and gazettes<a class=\"headerlink\" href=\"#get-a-list-of-international-newspapers-and-gazettes\" title=\"Permalink to this heading\">#</a></h1>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
